UML:TaggedValue.value:
The LC_PermittedRealRange metalanguage object is a subtype of <i>LC_PermittedRealValueType</i>. It is a metalanguage object for a real number value permitted in the metalanguage where the attribute <i>value</i> may be instantiated as a real number type using the Real type from the basic Primitive Types package in ISO 19103, where the value may be positive or negative. The sign convention is that negative values are depths and positive values are heights.
The inherited attribute <i>value</i> becomes the minimum value of the range and a new attribute <i>maxValue</i> describes the maximum value of the range, where the attributes <i>value</i> and <i>maxValue</i> may be instantiated as a pair of real number types using the Real type from the basic Primitive Types package in ISO 19103, with the constraints:
{<i>maxValue</i> &gt;=  <i>value</i>}
